import "./App.css";
import Post from "./components/post";

function App() {
  const posts = [
    { title: "t1", topic: "to1" },
    { title: "t2", topic: "to2" },
  ];

  return (
    <div className="App">
      {posts.map(function (post) {
        return <Post title={post.title} topic={post.topic} />;
      })}
    </div>
  );
}

export default App;
